import { useForm } from "react-hook-form"; // נראה שאין צורך בייבוא זה בקוד שלך
import TextField from '@mui/material/TextField';
import React from 'react';
import { useDispatch } from 'react-redux';
import { useNavigate, useLocation } from "react-router-dom";
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import DrawIcon from '@mui/icons-material/Draw';
import { putProduct } from "../../features/Product/ProductSlice";
import Grid from '@mui/material/Grid'; // הוספתי את הייבוא של Grid

const defaultTheme = createTheme();

const UpdateProduct = () => {
    const { state } = useLocation();
    const product = state?.p;

    const dispatch = useDispatch();
    const navigate = useNavigate();

    const  onSubmit= (data) => {
        const formData = new FormData();
        formData.append('product', JSON.stringify({
            name: data.name,
            description: data.description,
            price: data.price,
            imgUrl: data.imgUrl,
 
        }));
        formData.append('file', selectedFile);
        dispatch(putProduct({ id: product.id, updatedProduct: formData }));



        const handleFileChange = (event) => {
            setSelectedFile(event.target.files[0]);
            const reader = new FileReader();
            reader.onloadend = () => {
                setImageSrc(reader.result);
            };
            if (event.target.files[0]) {
                reader.readAsDataURL(event.target.files[0]);
            }
        };
        // console.log(newProduct);
        // dispatch(putProduct(newProduct));
        // navigate('/ProductList');
    };

    return (
        <ThemeProvider theme={defaultTheme}>
            <Container component="main" maxWidth="xs">
                <CssBaseline />
                <Box
                    sx={{
                        marginTop: 8,
                        display: 'flex',
                        flexDirection: 'column',
                        alignItems: 'center',
                    }}
                >
                    <Avatar sx={{ m: 1, bgcolor: '#00FF66' }}>
                        <DrawIcon />
                    </Avatar>
                    <Typography component="h1" variant="h5">
                        Update Product
                    </Typography>
                    <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 3 }}>
                        <Grid container spacing={2}>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    autoComplete="given-name"
                                    name="name"
                                    required
                                    fullWidth
                                    id="name"
                                    label="Name"
                                    autoFocus
                                    defaultValue={product1?.name}
                                />
                            </Grid>
                            <Grid item xs={12} sm={6}>
                                <TextField
                                    required
                                    fullWidth
                                    id="description"
                                    label="Description"
                                    name="description"
                                    autoComplete="description"
                                    defaultValue={product1?.description}
                                />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField
                                    required
                                    fullWidth
                                    id="price"
                                    label="Price"
                                    name="price"
                                    autoComplete="price"
                                    defaultValue={product1?.price}
                                />
                            </Grid>
                            <Grid item xs={12}>
                                <TextField
                                    required
                                    fullWidth
                                    name="imgUrl"
                                    label="Image URL"
                                    type="text"
                                    id="imgUrl"
                                    autoComplete="imgUrl"
                                    defaultValue={product1?.imgUrl}
                                />
                            </Grid>
                        </Grid>
                        <Button
                            type="submit"
                            fullWidth
                            variant="contained"
                            sx={{ mt: 3, mb: 2, bgcolor: '#00FF66' }}
                        >
                            Update
                        </Button>
                    </Box>
                </Box>
            </Container>
        </ThemeProvider>
    );
};

export default UpdateProduct;
